                    <div className="imgs-details-hero">
                        <img src={ detailsheroimg } alt="heroimg" />
                    </div>
                    <div className="text-details-hero">
                        <h1>Pastel Pink T-shirt</h1>
                        <p>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit.
